    function posTicket($tsn)
    {
        $sql = $this->ask_mysqli->select("entry", $_SESSION["db_1"]) . $this->ask_mysqli->whereSingle(array("utrno" => $tsn));
        $results = $this->adminDB[$_SESSION["db_1"]]->query($sql);
        if ($rows = $results->fetch_assoc()) {
            $sql = $this->ask_mysqli->select("subentry", $_SESSION["db_1"]) . $this->ask_mysqli->whereSingle(array("game" => $rows["game"]));
            $result = $this->adminDB[$_SESSION["db_1"]]->query($sql);
            $content = "";
            $barcode = $rows["game"];
            $ticket = array();
            while ($row = $result->fetch_assoc()) {
                // ob_start();
                // $this->isLoadView(array("header" => "webheader", "main" => "posticketPrint", "footer" => "webfooter", "error" => "page_404"), false, array("row" => $row));
                // $content = ob_get_contents();
                // ob_end_clean();
                // array_push($ticket, array("barcode" => $barcode, "ticket" => $content));
                // $content = "";
                //echo $content;
                $row["point"] = json_decode($row["point"], true);
                array_push($ticket, array("barcode" => $barcode, "ticket" => $row));
            }
            return array("status" => "1", "message" => "success", "ticket" => $ticket);
        } else {
            return array("status" => "0", "message" => "invalid trid or barcode");
        }
    }

